import React from 'react';
import PrincipalImage from "./PrincipalImage.png";

export default function PlacementOfficer() {
  return (
    <div>
      <h2>From the Desk of Training And Placement Officer</h2><hr />
      <div style={{textAlign:'center',padding:'5px'}}>
        <img src={PrincipalImage} alt="Placement Officer" />
        <p><b>Dr. N. Rajeshwari Devi</b><br />
        Training and Placement Officer.</p><br />
        Government Polytechnic Hyderabad.
      </div>
    </div>
  )
}
